import React, {useState} from 'react'
import './App.css';
import MyComponent from 'mycomponent'

function App() {

  const text = "Click Here"
  return (
    <div className="App">
      <h1>Hello</h1>
      <MyComponent 
      text = {text}
      />
    </div> 
  );
}

export default App;
